import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './styles.css';

function OrderItemsList() {
  const [orderItems, setOrderItems] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/order-items')
      .then(response => {
        setOrderItems(response.data);
      })
      .catch(error => {
        console.error('Błąd podczas pobierania danych zamówień:', error);
      });
  }, []);

  return (
    <div>
      <h2>Lista Zamówień (Order Items)</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Klient ID</th>
            <th>Produkt ID</th>
            <th>Czas ID</th>
            <th>Ilość</th>
            <th>Wartość</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {orderItems.map(orderItem => (
            <tr key={orderItem.zamowienie_id}>
              <td>{orderItem.zamowienie_id}</td>
              <td>{orderItem.klient_id}</td>
              <td>{orderItem.produkt_id}</td>
              <td>{orderItem.czas_id}</td>
              <td>{orderItem.ilosc}</td>
              <td>{orderItem.wartosc}</td>
              <td>{orderItem.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrderItemsList;
